strStadiumDescription: "Arizona Stadium is an outdoor college football stadium in Tucson, Arizona, on the campus of the University of Arizona. It is the home field of the Arizona Wildcats of the Pac-12 Conference. Originally constructed in 1928 to hold 7,000 spectators, the stadium's seating capacity has been expanded numerous times since. As of 2016, the stadium has a total capacity of 55,675. The facility also includes the offices of the Wildcat football program, as well as some non-athletic academic offices, including the Steward Observatory Mirror Lab.",
