strDescriptionEN: "The Arizona Wildcats football program represents the University of Arizona in the sport of American college football. Arizona competes in the Football Bowl Subdivision (FBS) of the National Collegiate Athletic Association (NCAA) and the South Division of the Pac-12 Conference (Pac-12). Arizona officially began competing in intercollegiate football in 1889. The school joined the Pac-10 Conference in 1978 alongside rival Arizona State, and became a member of the Pac-12 South Division when the conference realigned in 2011. Arizona has won six conference championships, including the 1993 Pac-10 title, and have appeared in 21 bowl games. Arizona's home stadium is Arizona Stadium, which opened in 1939 and has a capacity of 55,675. Arizona's archrival is in-state foe Arizona State Sun Devils. The Wildcats and Sun Devils meet annually in the Territorial Cup. As heading into the 2018 season, Arizona's all-time record is 605–449–33.",
