strDescriptionPT: "O Arizona Cardinals (também chamado de Cards) é um time de futebol americano da cidade de Glendale, Arizona que disputa a divisão oeste da Conferência Nacional da NFL. Foi fundado em 1898 em Chicago, é a mais antiga franquia de futebol americano, tendo sido um dos fundadores da NFL em 1920. Se mudou para o Arizona em 1988, após 27 anos em St. Louis (destino do time após sair de Chicago, em 1959), sendo originalmente chamado Phoenix Cardinals e jogando na cidade próxima de Tempe. Desde 2005 joga em Glendale, também na região metropolitana de Phoenix, no estádio da Universidade de Phoenix. Os Cardinals chegaram ao Super Bowl pela primeira vez em sua história na pós-temporada de 2009, depois de alcançar seu primeiro título na divisão oeste. No Super Bowl XLIII, foram derrotados pelo Pittsburgh Steelers por 27 a 23.",
