strStadiumDescription: "Talking Stick Resort Arena is a sports and entertainment arena in downtown Phoenix, Arizona, United States. It opened on June 6, 1992, at a construction cost of $89 million. It was known as America West Arena from 1992 to 2006 and as US Airways Center from 2006 to 2015. It is home to the Phoenix Suns of the National Basketball Association (NBA), the Phoenix Mercury of the Women's National Basketball Association (WNBA) and the Arizona Rattlers of the Indoor Football League. The Phoenix RoadRunners of the ECHL played at the arena from their inaugural 2005–06 season until they ceased operations at the conclusion of the 2008–09 season. Located near Chase Field, home of the Arizona Diamondbacks, the arena is one million square feet (93,000 m2) in size on an 11-acre (4.5 ha) site. These two major league sports venues are half of those used by Phoenix area professional teams, the other two being University of Phoenix Stadium and Gila River Arena in the neighboring Phoenix suburb of Glendale. Renovations were completed in March 2003, which feature a 16,000-square-foot (1,500 m2) air conditioned glass-enclosed atrium built on the northwest side of the arena, to keep patrons cool while waiting in line for tickets or spending time inside the building before events. The total cost was estimated at around $67 million. The upgrading of the arena was done as part of the Phoenix Suns' plan to keep it economically competitive after Gila River Arena opened. Former Suns owner Jerry Colangelo originally thought of the renovations after visiting Staples Center in Los Angeles and envisioned a similar entertainment district in Phoenix. The arena also features the Verve Lounge, a high-class exclusive bar lounge.",
