strStadiumDescription: "Sun Devil Stadium is an outdoor football stadium on the campus of Arizona State University, in Tempe, Arizona, United States. It is home to the Arizona State Sun Devils football team of the Pac-12 Conference. The stadium's current seating capacity is 57,078 and the playing surface is natural grass. The gridiron within the stadium was named Frank Kush Field in honor of the former coach of the ASU football team in 1996. Sun Devil Stadium is undergoing a $256 million renovation that is scheduled to be completed before the 2018 season. It was the major outdoor stadium in the Valley of the Sun until the construction of University of Phoenix Stadium in Glendale in 2006.",
