strDescriptionEN: "The Arizona State Sun Devils football team represents Arizona State University in the sport of American football. The Sun Devils team competes in the Football Bowl Subdivision (FBS) of the National Collegiate Athletic Association (NCAA) and the South Division of the Pac-12 Conference (Pac-12). Arizona State University has fielded a football team since 1897. The Sun Devils are currently led by head coach Herm Edwards and play their home games at Sun Devil Stadium in Tempe, Arizona. The Sun Devils have won seventeen conference titles, including three Pac-12 titles. A number of successful and professional football players once played for ASU. The school has 3 unanimous All-Americans and 16 consensus selections. Among the most lauded players the school has produced are Pat Tillman, Terrell Suggs, Mike Haynes, Darren Woodson, Charley Taylor, and John Henry Johnson. In addition to its players, ASU's football program has had several notable head coaches, including Hall of Famers Dan Devine and John Cooper and national champion Dennis Erickson. The all-time school wins leader is Hall of Fame coach Frank Kush, for whom Frank Kush Field at Sun Devil Stadium is named. Kush also consistently led the Sun Devils to victory against the Arizona Wildcats, ASU's traditional rival, losing to the Wildcats only twice between 1963 and 1979.",
