strStadiumDescription: "The home of the Atlanta Falcons of the National Football League (NFL) and the Atlanta United FC of Major League Soccer (MLS), it replaced the adjacent Georgia Dome, the Falcons' home stadium for a quarter century, from 1992 through 2016. Opened in 2017, Mercedes-Benz Stadium is owned by the state of Georgia through the Georgia World Congress Center Authority, and operated by AMB Group, the parent organization of the Falcons and Atlanta United. The total cost is estimated at $1.6 billion, as of June 2016. The stadium officially opened on August 26 with a Falcons preseason game against the Arizona Cardinals, despite the retractable roof system being incomplete. Contrary to earlier plans, the stadium roof would in fact be open during the Falcon's home opener on September 17 against the Green Bay Packers. The Mercedes-Benz Stadium is accessible by rail via MARTA's Blue and Green lines, which service the nearby Dome/GWCC/Philips Arena/CNN Center and Vine City stations.",
strStadiumLocation: "Atlanta, Georgia",
