strInstagram: "www.instagram.com/atlantafalcons",
strDescriptionEN: "The Atlanta Falcons are a professional American football team based in Atlanta, Georgia. They are a member of the South Division of the National Football Conference (NFC) in the National Football League (NFL). The Falcons joined the NFL in 1965 as an expansion team, after the NFL offered then-owner Rankin Smith a franchise to keep him from joining the rival American Football League (AFL). The AFL instead granted a franchise to Miami, Florida (the Miami Dolphins). They are tied with the Dolphins (who also began play in 1966) for being the oldest NFL franchise in the Deep South, and are the oldest NFC team in said region. In their 49 years of existence, the Falcons have compiled a record of 316–414–6 with division championships in 1980, 1998, 2004, 2010 and 2012. Their only Super Bowl appearance was during the 1998 season in Super Bowl XXXIII in Miami. The Falcons play their home games at the Georgia Dome in downtown Atlanta, but construction began on New Atlanta Stadium in May 2014, with play beginning in the 2017 season. Their headquarters and practice facilities are located at a 50-acre site in Flowery Branch, Georgia.",
