strDescriptionES: "Los Atlanta Falcons (en español Halcones de Atlanta) son un equipo profesional estadounidense de fútbol americano de la ciudad de Atlanta, Georgia. Forman parte de la NFC Sur de la National Football League (NFL). Juegan en el Georgia Dome desde 1992 con sede en Atlanta, Georgia.1 Los Falcons se unieron a la NFL en 19652 como un equipo de expansión, después de que la NFL le ofreciera al entonces propietario Rankin Smith una franquicia para que no se uniera a la liga rival, la American Football League (AFL). A su vez, la AFL le concedió una franquicia a Miami, Florida (Miami Dolphins). Tanto Falcons como Dolphins (quien también comenzaron a jugar en 1966) son las franquicias de la NFL más antiguas en el sur profundo, donde son los equipos de la NFC más antiguos de dicha región.",
strDescriptionPT: "O Atlanta Falcons é um time de futebol americano da cidade de Atlanta, Geórgia, que disputa a divisão Sul da Conferência Nacional (NFC) da National Football League (NFL), nos Estados Unidos. O Atlanta Falcons joga no estádio Georgia Dome, um estádio fechado,mas futuramente irá jogar no New Falcons Stadium,com a inauguração prevista para 2017. Seus rivais de divisão são o Tampa Bay Buccaneers, o New Orleans Saints e o Carolina Panthers. O uniforme principal do time é composto pela Jersey(camisa) vermelha com o número do jogador e uma calça branca. O capacete é preto com o símbolo do time. O time apareceu no Super Bowl uma vez apenas,quando perdeu para o Denver Broncos por 34-19 no Super Bowl XXXIII.",
