strStadiumDescription: "Royal Farms Arena (originally the Baltimore Civic Center and formerly Baltimore Arena) is an arena located in Baltimore. The arena is located about a block away from the Baltimore Convention Center on the corner of Baltimore Street and Hopkins Place; it is also only a short distance from the Inner Harbor. It seats 11,100 and can be expanded up to 14,000, depending upon the event. The arena officially opened October 23, 1962. Designed by AG Odell Jr. and Associates, it was built on the site of 'Old Congress Hall', where the Continental Congress met in 1776. As a major cornerstone for the Inner Harbor redevelopment during the 1980s, it was reopened after renovations and was renamed the Baltimore Arena in 1986. In 2003, it was renamed by 1st Mariner Bank, which purchased naming rights to the arena for 10 years. It was reported that 1st Mariner Bank paid the city $75,000 a year to keep the naming rights to the complex. When the naming rights agreement with 1st Mariner Bank ended in 2013, the arena was briefly returned to its 'Baltimore Arena' name, until Royal Farms purchased the naming rights to the arena in September 2014. The new naming rights deal calls for Royal Farms to pay $250,000 annually for five years to the city, and gives Royal Farms first rights to renew/restructure their deal at the end of the contract, or in the event that the city constructs a new arena. The Royal Farms Arena is owned by the city of Baltimore and is currently managed by SMG, a private management company. A cornerstone to the arena was laid in the arena in 1961 with a vault that included messages from then-U.S. President John F. Kennedy, then-Maryland governor J. Millard Tawes, and then-Baltimore Mayor J. Harold Grady. The vault was opened in 2006. The current site that was chosen for the Baltimore Civic Center was actually not one of the many sites proposed to the Greater Baltimore Committee in 1955. Among nine suggested locations there were two in Druid Hill Park, three at the end of the Inner Harbor basin (where the World Trade Center and Harborplace are now located), and one in Clifton Park.",
