strDescriptionEN: "The Baltimore Brigade is a professional arena football team to be based in Baltimore, Maryland, and scheduled to begin play in the Arena Football League (AFL) in 2017. The team's planned home arena is the Royal Farms Arena. The franchise is owned by Monumental Sports & Entertainment (Ted Leonsis, chairman), which also owns the Washington Valor of the AFL, Washington Wizards of the National Basketball Association (NBA), Washington Mystics of the Women's National Basketball Association (WNBA), and Washington Capitals of the National Hockey League (NHL).",
