strStadiumDescription: "Ralph Wilson Stadium (originally Rich Stadium) is an outdoor football stadium in the northeastern United States, located in Orchard Park, New York, a suburb south of Buffalo. Opened 42 years ago in 1973, it is the home of the Buffalo Bills of the National Football League. The stadium was renamed in 1998 for team founder and then-owner Ralph Wilson (1918–2014).",
strStadiumLocation: "Orchard Park, New York",
