strDescriptionEN: "The Carolina Cobras are a professional indoor football team in the National Arena League (NAL) and announced to begin play for the 2018 season. Based in Greensboro, North Carolina, the Cobras will play their home games at the Greensboro Coliseum Complex. The Cobras will be the third indoor/arena team to call Greensboro home, following the Greensboro Prowlers of the af2 (2000–2003) and the Greensboro Revolution of the National Indoor Football League (2006–2007). A previous team called the Carolina Cobras played in the Arena Football League from 2000 until 2004. The AFL Cobras played three seasons in Raleigh and two in Charlotte before folding. However, aside from the name, the NAL Cobras franchise has no connection to the AFL Cobras.",
