strStadiumThumb: "https://www.thesportsdb.com/images/media/team/stadium/zqljcs1490040187.jpg",
strStadiumDescription: "U.S. Cellular Center (formerly Five Seasons Center) is a multi-purpose arena located in the downtown area of Cedar Rapids, Iowa. It was financed by the approval of a voter referendum to allocate special municipal capital improvement bond monies, after several prior bond referendums to build a civic center failed between 1965 and 1977. The initial construction cost was approximately $7 million for the arena and facilities. The city approved an additional $1 million to build an adjacent multi-level parking facility connected to the center by a skywalk. The center is adjoined by a 16-story DoubleTree hotel facility built directly above the arena. The center hosts local sporting events and concerts, most notably the Iowa State High School Girls Volleyball Tournament and the Iowa High School Team Dual Wrestling Championships. It was opened in 1979 as the Five Seasons Center, and hosted the English progressive-rock band Yes as its first official concert event on April 25, 1979. The arena has a basketball capacity of about 6,900 and can seat up to 8,600 for concerts. It served as the primary sports and entertainment venue in Eastern Iowa until the completion of Carver–Hawkeye Arena in Iowa City four years later. Former professional tenants include the Cedar Rapids River Raiders of the United States Basketball League, the Cedar Rapids Sharpshooters of the Global Basketball Association and the Cedar Rapids Silver Bullets of the Continental Basketball Association. Numerous commencement ceremonies are held at the arena. Also, Phish played the arena in 1995. The venue hosted the initial WCW/nWo Souled Out event in 1997. It also hosted a WCW Clash of the Champions event in 1994 and a WCW Monday Nitro event in 1999. As the Five Seasons Center, it was the site of two early Ultimate Fighting Championship events: UFC 21 in 1999, and UFC 26 the following year. In early June 2008, the U.S. Cellular Center was flooded with water from the Iowa flood of 2008. The arena closed in July 2011 to undergo renovations as part of a larger project to build a convention complex around the site, which also includes renovations to the now DoubleTree by Hilton Hotel. The complex was re-opened for a concert by Lady Antebellum on June 1, 2013. It was selected as the host arena for the NCAA Division II National Volleyball tournament December 12–14, 2013. It is home to the Cedar Rapids Titans of the Indoor Football League, since 2014. On October 17th, 2014, US Cellular Center held an NBA preseason game between the Milwaukee Bucks and Minnesota Timberwolves.",
strStadiumLocation: "Cedar Rapids, Iowa",
intStadiumCapacity: "6900",
strWebsite: "titans.footballshift.com",
strFacebook: "www.facebook.com/cedarrapidstitans/",
strTwitter: "",
strInstagram: "",
strDescriptionEN: "The Cedar Rapids Titans are a professional indoor football team based in Cedar Rapids, Iowa. The Titans joined the Indoor Football League (IFL) as an expansion team in 2011, and first took the field for the 2012 season. They currently participate in the United Conference. The Titans played their home games at the Cedar Rapids Ice Arena in Cedar Rapids from 2012 to 2013. In 2014 they relocated to the newly renovated U.S. Cellular Center. The Titans were the first indoor team to be based in Cedar Rapids. The owners of the Titans are Chris Kokalis, Bob Sullivan, David Bradley and Kenneth Moninski. The Titans have appeared in two United Conference Championship Game (2013, 2014), losing to the Sioux Falls Storm both times.",
