strInstagram: "instagram.com/clevelandgladiators",
strDescriptionEN: "The Cleveland Gladiators are an arena football team based in Cleveland, Ohio, United States, who play in the Arena Football League (AFL) as part of the AFL National Conference. The Gladiators play their home games at Quicken Loans Arena, which they share with the Cleveland Cavaliers of the National Basketball Association and the Cleveland Monsters of the American Hockey League. The franchise was originally based in East Rutherford, New Jersey, and then later in Las Vegas, Nevada, before relocating to Cleveland for the 2008 AFL season. The Gladiators have qualified for the playoffs eight times in their history, reaching the ArenaBowl for the first time in 2014.",
