strDescriptionEN: "The Columbus Lions are a professional indoor football team based in Columbus, Georgia and a founding member of the National Arena League (NAL) for the 2017 season. The Lions were founded in 2006 as an expansion team of the World Indoor Football League (WIFL). After the WIFL went under in 2007, the Lions joined the American Indoor Football Association (AIFA) where they played for two seasons. When the AIFA broke apart, the Lions joined the Southern Indoor Football League (SIFL). The Lions joined the Professional Indoor Football League (PIFL) in 2012 when the Southern Indoor Football League (SIFL) teams split up into two new leagues. After the 2015 season, the PIFL broke apart, and the Lions joined American Indoor Football for 2016. In their ten years of existence, the Lions have compiled a record of 92–40 with division championships in 2009, 2011 and 2016. They have made four championship appearances: in the 2010 season where they defeated the Louisiana Swashbucklers in President's Cup II, in 2015 when they defeated the Richmond Raiders in PIFL Cup IV, in 2016 where they defeated the West Michigan Ironmen in the AIF Championship game, and in 2017 when the Lions lost to the Jacksonville Sharks 21–27 in the inaugural NAL Championship.",
