strStadiumDescription: "AT&T Stadium, formerly referred to as 'Cowboy Stadium', is a city-owned stadium with a retractable roof in Arlington, Texas, United States. It serves as the home of the Dallas Cowboys of the National Football League (NFL). It replaced the partially covered Texas Stadium, which opened in 1971 and served as the Cowboys' home through the 2008 season. It was completed on May 27, 2009. The facility can also be used for a variety of other activities outside of its main purpose (professional football) such as concerts, basketball games, college football and high school football contests, soccer matches, and motocross races. The maximum capacity of the stadium, including standing room-only capacity, is 105,121. The Party Pass (open areas) sections are behind seats in each end zone and on a series of six elevated platforms connected by stairways. It also has the world's largest column-free interior and the fourth largest high definition video screen, which hangs from 20-yard line to 20-yard line",
strStadiumLocation: "Arlington, Texas",
intStadiumCapacity: "105121",
strWebsite: "www.dallascowboys.com",
strFacebook: "www.facebook.com/DallasCowboys",
strTwitter: "www.twitter.com/dallascowboys",
strInstagram: "www.instagram.com/dallascowboys",
strDescriptionEN: "The Dallas Cowboys are a professional American football franchise that plays in the East division of the National Football Conference (NFC) of the National Football League (NFL). They are headquartered in Valley Ranch in Irving, Texas, a suburb of Dallas. The team plays its home games at AT&T Stadium in Arlington, Texas, within the Dallas–Fort Worth metropolitan area, which finished construction in time for the 2009 season. The Cowboys joined the NFL as a 1960 expansion team. The team's national following might best be represented by its NFL record of consecutive home sell-outs. The Cowboys' streak of 160 sold-out regular and post-season games began in 1990, and included 79 straight sellouts at their former home, Texas Stadium, and 81 straight sell-outs on the road. The franchise shares the record for most Super Bowl appearances (8) with the Pittsburgh Steelers, corresponding to most NFC championships (8). The Cowboys are the only NFL team to record 20 straight winning seasons (1966–85), in which they only missed the playoffs twice (1974 and 1984), an NFL record that remains unchallenged.",
