strStadiumDescription: "Sports Authority Field at Mile High, previously known as Invesco Field at Mile High, and commonly known as Mile High or Mile High Stadium, is an American football stadium in Denver, Colorado. The home facility of the Denver Broncos of the National Football League (NFL), it opened in 2001 to replace Mile High Stadium. The stadium was largely paid for by taxpayers in the Denver metropolitan area and the property is owned by a special taxing district. More controversially, Invesco paid $120 million for the original naming rights, before Sports Authority secured the naming rights on August 16, 2011.",
