strStadiumThumb: "",
strStadiumDescription: "Resch Center interior after a concert WWE Raw at Resch Center Resch Center Wide angle view of the arena The Resch Center is a 10,200 seat multi-purpose arena, in Green Bay, Wisconsin, United States. Built in 2002, it is the home of the University of Wisconsin–Green Bay Phoenix men's basketball team, the Green Bay Gamblers ice hockey team, and the Green Bay Blizzard indoor football team. The arena was built next to the existing Brown County Veterans Memorial Arena and across the street from Lambeau Field on a site formerly home to the Green Bay Packers Hall of Fame from 1976 until 2001. It was named for executive Dick Resch of a local office furniture company KI Industries, which holds the arena's naming rights.",
