strFacebook: "",
strTwitter: "",
strInstagram: "",
strDescriptionEN: "The Green Bay Blizzard is a professional indoor football team, founded in 2003. The Blizzard began play in the Indoor Football League in 2010, after having played the previous seven seasons in af2, the now-defunct minor league of the Arena Football League. The Blizzard play in the United Conference. They play their home games at the Resch Center in Ashwaubenon, Wisconsin. The team's logo represents Bruiser, the team mascot. The team was formerly owned by a group headed by former Green Bay Packers linebacker Brian Noble; in October 2009 it was announced that a group of local businessmen formed Titletown Football Group, LLC and had purchased the team. In September 2013, it was announced that Matt Umentum, Tom Burgess, John Meyer, and Bob Weyers sold their ownership shares to Larry and Kathy Treankler.",
