intFormedYear: "1919",
strSport: "American Football",
strLeague: "NFL",
idLeague: "4391",
strDivision: null,
strManager: "Matt Lafleur",
strStadium: "Lambeau Field",
strKeywords: "",
strRSS: "",
strStadiumThumb: "https://www.thesportsdb.com/images/media/team/stadium/wuyywv1421331810.jpg",
strStadiumDescription: "Lambeau Field is an outdoor athletic stadium in the north central United States, located in Green Bay, Wisconsin. The home field of the Green Bay Packers of the National Football League (NFL), it opened 60 years ago in 1957 as City Stadium, replacing the original City Stadium at East High School as the Packers' home field. Informally known as New City Stadium for its first eight seasons, it was renamed in August 1965 in memory of Packers founder, player, and long-time head coach, Curly Lambeau, who had died two months earlier. The stadium's street address has been 1265 Lombardi Avenue since August 1968, when Highland Avenue was renamed in honor of former head coach Vince Lombardi. It sits on a block bounded by Lombardi Avenue (north); Oneida Street (east); Stadium Drive and Valley View Road (south); and Ridge Road (west). The playing field at the stadium has a conventional north-south alignment, at an elevation of 640 feet (195 m) above sea level. The stadium completed its latest renovation in the summer of 2013 with the addition of 7,000 seats high in the south end zone. About 5,400 of the new seating is general, while the remaining 1,600 seats are club or terrace suite seating. With a capacity of 81,441, Lambeau Field is the third-largest stadium in the NFL with standing room, but is second in normal capacity. It is now the largest venue in the state, edging out Camp Randall Stadium (80,321) at the University of Wisconsin in Madison. Lambeau Field is the oldest continually operating NFL stadium. In 2007, the Packers completed their 51st season at Lambeau, breaking the all-time NFL record set by the Chicago Bears at Wrigley Field (1921–70). (While Soldier Field in Chicago is older, it was not the home of the Bears until 1971.) Only the Boston Red Sox at Fenway Park and the Chicago Cubs at Wrigley have longer active home-field tenures in American professional sports.",
strStadiumLocation: "Green Bay, Wisconsin",
intStadiumCapacity: "80735",
strWebsite: "www.packers.com",
strFacebook: "www.facebook.com/Packers",
strTwitter: "twitter.com/packers",
strInstagram: "www.instagram.com/packers/?hl=en",
strDescriptionEN: "The Green Bay Packers is a professional American football team based in Green Bay, Wisconsin. The Packers compete in the National Football League (NFL) as a member club of the league's National Football Conference (NFC) North division. It is the third-oldest franchise in the NFL, dating back to 1919, and is the only non-profit, community-owned major league professional sports team based in the United States. Home games have been played at Lambeau Field since 1957. The Packers is the last of the 'small town teams' which were common in the NFL during the 1920s and 30s. Founded in 1919 by Earl 'Curly' lambeau and George Whitney Calhoun, the franchise traces its lineage to other semi-professional teams in Green Bay dating back to 1896. Between 1919 and 1920, the Packers competed against other semi-pro clubs from around Wisconsin and the Midwest, before joining the American Professional Football Association (APFA), the forerunner of today's NFL, in 1921. Although Green Bay is by far the smallest major league professional sports market in North America, its local fan and media base extends 120 miles south into Milwaukee, where it played selected home games between 1933 and 1994. And despite its small market, Forbes ranked the Packers as the world's 26th most valuable sports franchise in 2016, with a value of $2.35 billion. The Packers have won 13 league championships, the most in NFL history, with nine pre-Super Bowl NFL titles in addition to four Super Bowl victories. The Packers won the first two Super Bowls in 1967 and 1968 and were the only NFL team to defeat the American Football League (AFL) prior to the AFL–NFL merger. The Vince Lombardi Trophy is named after the Packers' coach Lombardi, who guided them to their first two Super Bowls. Their two additional Super Bowl wins came in 1997 and 2011. The Packers are long-standing adversaries of the Chicago Bears, Minnesota Vikings, and Detroit Lions, who today comprise the NFL's NFC North division, and were formerly members of the NFC Central Division. The Bears–Packers rivalry is one of the oldest in NFL history, dating back to 1921.",
