strStadiumDescription: "Lucas Oil Stadium is a multi-purpose stadium in downtown Indianapolis, Indiana, United States. It replaced the RCA Dome as the home field of the NFL's Indianapolis Colts. The stadium also hosted Super Bowl XLVI in 2012. The stadium had its ribbon-cutting ceremony August 16, 2008, and then officially opened to the public eight days later on August 24, 2008. The stadium was constructed to allow the removal of the RCA Dome and expansion of the Indiana Convention Center on its site. The stadium is on the south side of South Street, the block south of the site of the former RCA Dome. The stadium is often referred to as 'The House That Manning Built', even though Peyton Manning no longer plays for the Indianapolis Colts. In addition to serving as a football stadium, the Lucas Oil Stadium is also the well-known site for two famous music competitions in the United States; the Bands of America Grand National Championships, which feature some of the highest achieving high school marching bands; and the Drum Corps International Championships. Both organizations serve corps style bands. On February 28, 2006, prior to the construction of the stadium, Forrest Lucas announced that Lucas Oil had purchased the naming rights for $121 million over 20 years. The architectural firm HKS, Inc. was responsible for the stadium’s design, with Walter P Moore working as the Structural Engineer of Record. The stadium features a retractable roof and window wall, thus allowing the Colts to play both indoors and outdoors. The implementation of these elements of kinetic architecture provides for quick conversion of the facility to accommodate a variety of events. The field surface is FieldTurf. The exterior of the new stadium is faced with a reddish-brown brick trimmed with Indiana Limestone; similar to several other sports venues in the area such as Bankers Life Fieldhouse, Hinkle Fieldhouse, and the Fairgrounds Coliseum. The architectural style complements other older structures in the downtown area.",
strStadiumLocation: "Indianapolis, Indiana",
intStadiumCapacity: "62421",
strWebsite: "www.colts.com",
strFacebook: "www.facebook.com/colts",
strTwitter: "twitter.com/colts",
strInstagram: "www.instagram.com/colts/?hl=en",
strDescriptionEN: "The Indianapolis Colts are an American football team based in Indianapolis, Indiana; they play their games in Lucas Oil Stadium, since 2008. Previously, the team had played for over two decades (1984-2007) at the RCA Dome. The team is a member of the South Division of the American Football Conference (AFC) in the National Football League (NFL). The Colts have been members of the National Football League from their founding in Baltimore and were one of three NFL teams to join the teams of the American Football League to form the American Football Conference following the 1970 merger. While in Baltimore, the team advanced to the postseason ten times and won three NFL Championship games, in 1958, 1959, and 1968. The Colts had two Super Bowl appearances while in Baltimore, losing to the New York Jets in Super Bowl III, while defeating the Dallas Cowboys in Super Bowl V. The Colts moved to Indianapolis in 1984 and have since appeared in the playoffs sixteen times, won two conference championships, and won one Super Bowl, defeating the Chicago Bears in Super Bowl XLI. The 2014 season was the team's thirty-first in Indianapolis, equaling their length of tenure in Baltimore.",
