strStadiumDescription: "Wells Fargo Arena is a 16,980-seat multi-purpose arena in Des Moines, Iowa, United States. Part of the Iowa Events Center, the arena opened on July 12, 2005, at a cost of $117 million. Named for title sponsor Wells Fargo, the arena replaced the aging Veterans Memorial Auditorium as the Des Moines area's primary venue for sporting events and concerts. The first event held at the arena was Tony Hawk's Boom-Boom Huck Jam, on July 14, while its first concert, Tom Petty and the Heartbreakers, with The Black Crowes, was held on July 18. Wells Fargo Arena seats 15,181 for hockey games, 16,110 for basketball games, and as many as 16,980 for concerts. It also features the Principal River's Edge Restaurant, which provides views of the Des Moines River and the Iowa State Capitol. The restaurant opened on October 6, 2005, coinciding with the Iowa Stars' inaugural home game. The Arena is also connected to the rest of the Iowa Events Center as well as Downtown Des Moines through the city's extensive Skywalk system, providing easy access.",
