strDescriptionEN: "The Iowa Barnstormers are a professional indoor football team based in Des Moines, Iowa. They are currently members of the United Conference of the Indoor Football League (IFL). They play their home games at Wells Fargo Arena, known in indoor football circles as 'The Well'. Several teams called the Iowa Barnstormers have played in different indoor football leagues since 1995. The original Arena Football League team played in Des Moines' Veterans Memorial Auditorium from 1995 to 2001, and subsequently relocated to Uniondale, New York, where they were known as the New York Dragons. Des Moines was awarded a franchise in the developmental AF2 league in 2001 that carried on the Barnstormers name and branding, but the team suspended operations after the end of the season. In 2008 a new Barnstormers team began play in the AF2, now based in the new Wells Fargo Arena; this team joined the new AFL in 2010 following the league's reorganization. For the 2015 season, the Barnstormers left the AFL and became members of the IFL.",
