strDescriptionEN: "The Jacksonville Jaguars are an American professional football franchise based in Jacksonville, Florida. They are members of the South Division of the American Football Conference (AFC) of the National Football League (NFL). Their home stadium is EverBank Field. The Jaguars and the Carolina Panthers became active NFL teams in 1995. Since their inception, the Jaguars have won division championships in 1998 and 1999 (as members of the defunct AFC Central) and have qualified for the playoffs six times, most recently in 2007 From their inception until 2011, the Jacksonville Jaguars' majority owner was Wayne Weaver. The team was then purchased by Pakistani-born businessman Shahid Khan for an estimated $770 million.",
