strStadiumDescription: "David Booth Kansas Memorial Stadium is a football stadium located in Lawrence, Kansas, on the campus of the University of Kansas. The stadium is dedicated as a memorial to Kansas students who died in World War I, and is one of seven major veteran's memorials on the campus. The stadium is at the center of all seven war memorials - adjacent to the stadium, further up the hill is a Korean War memorial honoring Kansas students who served, just a few hundred feet south of the stadium stands the University of Kansas World War II Memorial, the Kansas Memorial Campanile and Carillon , the University of Kansas Vietnam War Memorial sits adjacent to the Campanile to the west, the Victory Eagle - World War I statue located on Jayhawk Boulevard, southeast of the stadium, and the Kansas Memorial Union, a veteran's memorial that also houses the main university student union and bookstore, located east of the stadium. The stadium is the home stadium of the Kansas Jayhawks football team. On December 20, 2017, KU Chancellor Douglas Girod announced that the stadium would be renamed in honor of KU alumnus and donor David G. Booth, who pledged a donation of $50 million to overhaul the facility.",
strStadiumLocation: "Lawrence, Kansas, USA",
intStadiumCapacity: "50071",
