strDescriptionEN: "The Lehigh Valley Steelhawks are a professional indoor football team based in Allentown, Pennsylvania and are members of the National Arena League (NAL). The Steelhawks began play as an expansion team in the Indoor Football League (IFL) in 2011. The Steelhawks moved to the Professional Indoor Football League (PIFL) in 2013, where they made their only championship game appearance to date, losing PIFL Cup III to the Nashville Venom. The team joined American Indoor Football for the 2016 season after the PIFL folded. The Steelhawks are the Lehigh Valley's second indoor football team, following the defunct Lehigh Valley Outlawz of the Continental Indoor Football League (2005–2008). Both teams played their home games at Stabler Arena. The owner of the Steelhawks is Glenn Clark. The Steelhawks play their home games at the PPL Center.",
