strStadiumDescription: "Built upon three acres of property, this newly renovated multi-purpose stadium is home to LIU Post football, field hockey, and men’s and women’s lacrosse. Standing as one of the most modern and advanced Division II facilities on the east coast, Bethpage Federal Credit Union Stadium boasts a seating capacity of over 4,000, with 816 seatbacks installed during the most recent renovation. For our student-athletes, the facility is lined with four sets of playing lines with distinct colors to make playing fields easily identifiable on our synthetic turf surface. Both the north and south end zones are laid in LIU Post gold with “LIU Post” inscribed in dark green. At midfield, the Pioneer athletic shield stretches nearly 20 yards to give an identifiable symbol to the playing surface. Alternating dark and light turf sits every five yards to helps athletes and fans alike distinguish areas of the field during play. As a fan, the stadium gives the ultimate game day experience at LIU Post, with ample amount of seating and uninterrupted sightlines anywhere in the stands. Several VIP areas are also available in the stadium, with our Pioneer Suite housing special guests during each football game. This area allows for premium seating in a setting to make you feel at home while catching the game. Beer, wine, soda, and small bite food is served in the suite during football games and select events throughout the year. Two other VIP areas are also available, with a covered outdoor area featuring cushioned chairbacks at the 50-yard line, and another climate controlled indoor box with cushioned seats.",
strStadiumLocation: "Brookville, NY",
intStadiumCapacity: "4000",
strWebsite: "liuathletics.com",
strFacebook: "www.facebook.com/LIUAthletics/",
strTwitter: "twitter.com/LIUAthletics",
strInstagram: "",
strDescriptionEN: "The LIU Post Pioneers (also Long Island–Post Pioneers and formerly the C.W. Post Pioneers) are the athletic teams that represent the C.W. Post Campus of Long Island University, located in Brookville, New York, in NCAA Division I intercollegiate sports. The Pioneers compete as members of the East Coast Conference for most sports; the football team is an affiliate of the Northeast-10 Conference. LIU Post has been a member of the ECC since 1989, when the league was established as the New York Collegiate Athletic Conference. The LIU Post Pioneers will pass into history when LIU merges them with the Division I LIU Brooklyn Blackbirds after the 2018–19 academic year. A new name and mascot will be named by the alumni and students of the two campuses. Since LIU Brooklyn has always been a Division I program, the Division II LIU Post teams for sports that have not been sponsored by LIU Brooklyn will move up immediately to Division I without the usual transition period for an institution moving to a different division. Teams for sports sponsored by both campuses will be merged, and DII athletes unable to make the DI teams will either be allowed to continue their athletic scholarships without competing or to be granted waivers that allow them to transfer to another DII school without having to sit out a season. The unified LIU athletics program will compete in the Northeast Conference, which has the Brooklyn campus as a member.",
