strStadiumDescription: "The Mercedes-Benz Superdome, often referred to simply as the Superdome, is a domed sports and exhibition venue located in the Central Business District of New Orleans, Louisiana, United States. It primarily serves as the home venue for the New Orleans Saints of the National Football League (NFL), and is also the home stadium for the Sugar Bowl and New Orleans Bowl in college football. Plans were drawn up in 1967 by the New Orleans modernist architectural firm of Curtis and Davis and the building opened as the Louisiana Superdome in 1975. Its steel frame covers a 13-acre (5.3 ha) expanse and the 273-foot (83 m) dome is made of a lamellar multi-ringed frame and has a diameter of 680 feet (210 m), making it the largest fixed domed structure in the world. It is adjacent to the Smoothie King Center. Because of the building's size and location in one of the major tourist destinations of the United States, the Superdome routinely hosts major sporting events, including the Super Bowl, College Football Championship Game, and the Final Four in college basketball. The stadium was also the long-time home of the Tulane Green Wave football team of Tulane University until 2013 (when they returned on-campus at Yulman Stadium) and was the home venue of the New Orleans Jazz of the National Basketball Association (NBA) from 1975 until 1979. The Superdome gained international attention of a different type in 2005 when it housed thousands of people seeking shelter from Hurricane Katrina. The building suffered extensive damage as a result of the storm, and was closed for many months afterward. It was eventually decided the building would be fully refurbished and reopened in time for the Saints' 2006 home opener on September 25. On October 3, 2011, it was announced that German automaker Mercedes-Benz purchased naming rights to the stadium. The new name took effect on October 23, 2011. At that time, it was the third stadium that has naming rights from Mercedes-Benz (and first in the United States), after the Mercedes-Benz Arena, the stadium of Bundesliga club VfB Stuttgart, in Stuttgart, Germany, and the Mercedes-Benz Arena in Shanghai, China. Atlanta's Mercedes-Benz Stadium (home of the Falcons, who, like the Saints, play in the NFC South), which opened in 2017, became the fifth stadium (and second in the NFL) to bear the name of the German automaker.",
strStadiumLocation: "New Orleans, Louisiana",
intStadiumCapacity: "73208",
