strStadiumDescription: "MetLife Stadium is a sports stadium located at the Meadowlands Sports Complex in East Rutherford, New Jersey, United States. It is the home of the New York Giants and New York Jets of the National Football League and is adjacent to the site of the former Giants Stadium, which was home to the Giants from 1976 until December 2009 and the Jets from 1984 until January 2010. Like its predecessor, MetLife Stadium is the only NFL stadium shared by two teams. The stadium is owned by the New Jersey Sports and Exposition Authority on paper. However, the New York Giants and New York Jets jointly built the stadium using private funds, and operate it through the MetLife Stadium Company, a 50/50 joint venture between the two teams. In contrast, the Jets were tenants of the NJSEA at Giants Stadium. The NJSEA continues to provide security and emergency medical services staff under contract to the stadium, as they have done in the past at Giants Stadium. The stadium opened as New Meadowlands Stadium on April 10, 2010, featuring the Big City Classic lacrosse event. In 2011, MetLife, an insurance company based in New York City, acquired the naming rights to the stadium. At a construction cost of approximately $1.6 billion, it is the most expensive stadium ever built and is the second–largest stadium in the NFL in terms of seating capacity. As Giants Stadium approached 30 years of age, it was becoming one of the older stadiums in the NFL. The Jets, who had been the lesser tenants in the Meadowlands, sought to have their own stadium built in Manhattan proper, the proposed West Side Stadium. Originally intended to be the 85,000-seat main stadium for New York's bid for the 2012 Summer Olympics, it was designed to be downsized to 75,000 seats for the Jets. However, the West Side Stadium would have required significant public funding, which collapsed in 2005. The Jets then entered into a partnership with the Giants to build a new stadium in which the two teams would be equal partners.",
