strStadiumDescription: "MetLife Stadium is a sports stadium located at the Meadowlands Sports Complex in East Rutherford, New Jersey, USA. It is the home of the New York Giants and New York Jets of the National Football League and is adjacent to the site of the former Giants Stadium, which was home to the Giants from 1976 until December 2009 and the Jets from 1984 until January 2010. Like its predecessor, MetLife Stadium is the only NFL stadium shared by two teams. The stadium is owned by the New Jersey Sports and Exposition Authority on paper. However, the New York Giants and New York Jets jointly built the stadium using private funds, and operate it through the MetLife Stadium Company, a 50/50 joint venture between the two teams. In contrast, the Jets were tenants of the NJSEA at Giants Stadium. The NJSEA continues to provide security and emergency medical services staff under contract to the stadium, as they have done in the past at Giants Stadium. The stadium opened as New Meadowlands Stadium on April 10, 2010, featuring the Big City Classic lacrosse event. In 2011, MetLife, an insurance company based in New York City, acquired the naming rights to the stadium. At a construction cost of approximately $1.6 billion, it is the most expensive stadium ever built and is the second–largest stadium in the NFL in terms of seating capacity.",
strStadiumLocation: "East Rutherford, New Jersey",
intStadiumCapacity: "82566",
strWebsite: "www.newyorkjets.com",
strFacebook: "www.facebook.com/Jets",
strTwitter: "twitter.com/nyjets",
strInstagram: "www.instagram.com/nyjets/?hl=en",
strDescriptionEN: "The New York Jets are a professional American football team located in the New York metropolitan area. The team is a member of the Eastern Division of the American Football Conference (AFC) in the National Football League (NFL). The team is headquartered in Florham Park, New Jersey. In a unique arrangement for the league, the Jets share MetLife Stadium in East Rutherford, New Jersey with the New York Giants. The franchise is legally and corporately registered as New York Jets, LLC. The team was founded in 1959 as the Titans of New York, an original member of the American Football League; later, the franchise joined the NFL in the AFL–NFL merger. The team began to play in 1960 at the Polo Grounds. Under new ownership, the current name was adopted in 1963 and the franchise was relocated to Shea Stadium in 1964 and then to the Meadowlands Sports Complex in 1984. The Jets advanced to the playoffs for the first time in 1968 and went on to compete in Super Bowl III where they defeated the Baltimore Colts, becoming the first AFL team to defeat an NFL club in an AFL-NFL World Championship Game. Since 1968, the Jets have appeared in the playoffs thirteen times, and in the AFC Championship Game four times, most recently losing to the Pittsburgh Steelers in 2010. However, the Jets have never returned to the Super Bowl, making them one of three NFL teams to win their lone Super Bowl appearance, along with the New Orleans Saints and Tampa Bay Buccaneers. The team's training facility, Atlantic Health Jets Training Center, which opened in 2008, is located in Florham Park. The team currently holds their annual training camp sessions on the campus of the State University of New York at Cortland in Cortland, New York while holding occasional sessions at the Florham Park complex.",
