strStadiumDescription: "Notre Dame Stadium is an outdoor football stadium in Notre Dame, Indiana, the home field of the University of Notre Dame Fighting Irish. It is located on the university's campus and also hosts commencement. Opened 88 years ago on October 4, 1930, the stadium seating capacity was nearly 60,000 for decades. More than 21,000 seats were added for the 1997 season, which increased the capacity to over 80,000. After the Campus Crossroads renovation, the seat number decreased to 77,622. The playing surface was changed to FieldTurf in 2014, after 84 seasons on natural grass.",
