strStadiumDescription: "O.co Coliseum (originally known as Oakland–Alameda County Coliseum and commonly Oakland Coliseum) is a multi-purpose stadium, located in Oakland, California, in the Coliseum Industrial area. It is the only multi-purpose stadium left to serve as a full-time home to both a Major League Baseball team (the Oakland Athletics) and a National Football League team (the Oakland Raiders) in the United States. The Coliseum was also home to the San Jose Earthquakes of Major League Soccer, who used the stadium for several games during their 2008–2009 seasons. It also was the host of some games of the 2009 CONCACAF Gold Cup. The Coliseum contains 6,300 club seats (of which 2,700 are available for Athletics games) and 143 luxury suites (of which 125 are available for Athletics games), with a variable seating capacity of 35,067 for baseball, 56,057 for football, and either 47,416 or 63,132 for soccer, depending on its configuration. O.co Coliseum is currently the fourth smallest NFL stadium by seat capacity, and the second smallest MLB stadium by seat capacity. The Coliseum is part of the Oakland–Alameda County Coliseum complex, which consists of the stadium and neighboring Oracle Arena.",
strStadiumLocation: "Oakland, California",
intStadiumCapacity: "56057",
strWebsite: "www.raiders.com",
strFacebook: "www.facebook.com/Raiders",
strTwitter: "twitter.com/raiders",
strInstagram: "instagram.com/raiders",
strDescriptionEN: "The Oakland Raiders are a professional American football franchise based in Oakland, California. The Raiders began play in 1960 as a member of the American Football League (AFL); they have been members of the National Football League (NFL) since the 1970 AFL–NFL merger. As of the 2014 season, the Raiders belong to the West division of the American Football Conference. Over the span of fifty-four seasons, the Raiders have experienced considerable success. Entering the 2014 season the Raiders have an all-time regular season record of 434–375–11, with a playoff record of 25–18. In the club's first three seasons (1960–1962), the team struggled both on and off the field. In 1963, the Raiders appointed eventual owner/general manager Al Davis to the position of head coach. Under Davis' guidance, the team's fortunes improved dramatically. In 1967, the Raiders reached the postseason for the first time; they went on to win their first, and only, AFL title that year by beating the Houston Oilers in the Championship Game, but they were defeated by the Green Bay Packers in Super Bowl II. The Raiders' run of success grew during the 1970s; during this time, they won six division titles and played in six AFC championship games. In 1976, the team captured its first championship by defeating the Minnesota Vikings in Super Bowl XI. In 1980, the Raiders unexpectedly won a second championship by defeating the Philadelphia Eagles in Super Bowl XV, at the time being the first NFL team to have ever done so as the wild card team in the playoffs. Two years later, the franchise relocated to Los Angeles. In 1983 (their second season since the move), they defeated the Washington Redskins in Super Bowl XVIII to capture a third championship. The Raiders' fortunes declined considerably following the 1985 season; they would win just one division title (1990) and two playoff games over their final nine seasons in Los Angeles. In 1995, the team returned to Oakland. In the early 2000s, the Raiders experienced a massive (albeit brief) resurgence; their renaissance culminated with a 2002 loss to the Tampa Bay Buccaneers in Super Bowl XXXVII. The team struggled significantly in the years following that Super Bowl loss. While the Raiders' fortunes somewhat improved in 2010 and 2011, they have not reached the playoffs (or attained a winning record) in 11 seasons. They most recently finished 3–13 in 2014. Today, the Raiders are known for their extensive fan base and distinctive team culture. Since 1960, the team has won fifteen division titles (three AFL and twelve NFL), three Super Bowls, four AFC titles (1976, 1980, 1983, and 2002) and an AFL Championship. Thirteen former members of the team have been enshrined in the Pro Football Hall of Fame.",
