strStadiumDescription: "The Wells Fargo Center is a multi-purpose indoor arena located in Philadelphia, Pennsylvania. It is the home arena of the Philadelphia 76ers of the National Basketball Association (NBA), the Philadelphia Flyers of the National Hockey League (NHL), and the Philadelphia Soul of the Arena Football League. The arena lies at the southwest corner of the South Philadelphia Sports Complex, which includes Lincoln Financial Field, Citizens Bank Park, and Xfinity Live!. The Wells Fargo Center, originally called Spectrum II, was completed in 1996 to replace the Spectrum as the home arena of the 76ers and Flyers, on the former site of John F. Kennedy Stadium at a cost of $210 million, largely privately financed (though the city and state helped to pay for the local infrastructure). It is owned by Comcast Spectacor, which also owns the Flyers, and is operated by its arena-management subsidiary, Global Spectrum. Since opening, it has been known by a number of different names through naming rights deals and bank mergers, including CoreStates Center from 1996 to 1998, First Union Center from 1998 to 2003, and Wachovia Center from 2003 to 2010. Since 2010, naming rights have been held by financial services company Wells Fargo, after their merger with Wachovia. In addition to hosting home games for its main tenants, the arena has been the site of a number of other notable athletic events including games from the 1997 and 2010 Stanley Cup Finals, games of the 2001 NBA Finals, and various collegiate events for the National Collegiate Athletic Association (NCAA). Wells Fargo center has hosted two political conventions, hosting the 2000 Republican National Convention and 2016 Democratic National Convention. In addition, the arena is a regular venue for concerts and WWE events.",
