strDescriptionEN: "The Philadelphia Soul are a professional arena football team based in Philadelphia, Pennsylvania. They compete in the Arena Football League (AFL). The Soul have made four ArenaBowl appearances, winning their first appearance (2008 against the San Jose SaberCats) and losing their next two appearances (2012 and 2013 both to the Arizona Rattlers). The Soul won their fourth appearance, against the Arizona Rattlers in 2016, winning 56-42. The club was established in 2004 when a group, led by Jon Bon Jovi, secured the rights to an AFL franchise in Philadelphia. The AFL folded before the proposed 2009 season was to begin, but was purchased and revived in 2010. After two seasons of inactivity in 2009 and 2010, the Soul returned in 2011 headed by Ron Jaworski.",
