strStadiumThumb: "https://www.thesportsdb.com/images/media/team/stadium/qsursx1421813869.jpg",
strStadiumDescription: "Qualcomm Stadium (formerly San Diego Stadium and San Diego Jack Murphy Stadium; a.k.a. 'The Q' and 'The Murph') is a multi-purpose stadium, in San Diego, California, in the Mission Valley area. The stadium's naming rights are owned by Qualcomm. It is the current home of the NFL's San Diego Chargers and the San Diego State University Aztecs college football team. It hosts the National University (California) Holiday Bowl and the San Diego County Credit Union Poinsettia Bowl college football games every December. Until 2003, it served as the home of the MLB's San Diego Padres. The stadium has hosted three Super Bowl games: Super Bowl XXII in 1988, Super Bowl XXXII in 1998, and Super Bowl XXXVII in 2003. It has also hosted the 1978 and 1992 Major League Baseball All-Star Games, the 1996 and 1998 National League Division Series, the 1984 and 1998 National League Championship Series, and the 1984 and 1998 World Series. It is the only stadium ever to host both the Super Bowl and the World Series in the same year (1998). It is one of three stadiums to host the World Series, MLB All-Star Game, and Super Bowl, joining the Hubert H. Humphrey Metrodome in Minneapolis (1987 World Series, 1991 World Series, Super Bowl XXVI, and 1985 Major League Baseball All-Star Game) and Los Angeles Memorial Coliseum (1959 World Series, the second All-Star Game in 1959, and Super Bowls I and VII). The stadium is located immediately northwest of the interchange of Interstate 8 and Interstate 15. The neighborhood surrounding the stadium is known as Mission Valley, in reference to the Mission San Diego de Alcalá, which is located to the east, and its placement in the valley of the San Diego River. The stadium is served by the Qualcomm Stadium San Diego Trolley station, accessible via the Green Line running toward Downtown San Diego to the west, and Santee to the east.",
strStadiumLocation: "San Diego, California",
intStadiumCapacity: "70561",
strWebsite: "www.chargers.com",
strFacebook: "www.facebook.com/chargers",
strTwitter: "twitter.com/chargers",
strInstagram: "instagram.com/chargers",
strDescriptionEN: "The history of the San Diego Chargers begins in 1959 with the foundation of the professional American football team (now known as the Los Angeles Chargers) when it was made a charter member of the American Football League (AFL). The team played the 1960 season in Los Angeles and moved to San Diego the following year, where they played from 1961 until 2016. In 2017 when the Chargers moved their practice facility to Orange County, the Chargers removed all references to the city of San Diego from their website and merchandise. The Chargers returned to Los Angeles in 2017.",
