strStadiumDescription: "The Denny Sanford Premier Center is a large, multi-use indoor arena in Sioux Falls, South Dakota. The building is located at 1201 North West Avenue, and is connected to the Sioux Falls Arena and Sioux Falls Convention Center, and is adjacent to Howard Wood Field, and Sioux Falls Stadium. The arena's naming rights partners, and largest sponsors, are Sanford Health, First Premier Bank and Premier Bankcard. Completed in 2014, it has a seating capacity of approximately 12,000 spectators and replaces the Rushmore Plaza Civic Center as the largest venue in South Dakota. The Sioux Falls Arena remains and hosts smaller concerts and events, while the Denny Sanford Premier Center hosts large scale concerts and sporting events.",
