strDescriptionEN: "The Sioux Falls Storm are a professional indoor football team based in Sioux Falls, South Dakota. The Storm joined the original Indoor Football League as an expansion team in 1999 as the Sioux Falls Cobras, and first took the field for the 2000 season. They currently participate in the United Conference of the current Indoor Football League (IFL); prior to that, the Storm were in United Indoor Football (UIF), where they won all four of the league's championship games. They play their home games at Denny Sanford Premier Center. In mid-April 2014, the team announced that the 2014 season would be its last at the aging Sioux Falls Arena (also known as the Storm Shelter), originally constructed in 1961. In 2015, the Storm followed the Sioux Falls Stampede of the United States Hockey League to the newly constructed Denny Sanford Premier Center.",
