strStadiumDescription: "The Dome at America's Center or The Dome, is a multi-purpose stadium in St. Louis, Missouri, United States. It primarily served as the home of the St. Louis Rams from 1995 until 2015 when the Rams relocated back to Los Angeles in 2016. The stadium, previously known as the Trans World Dome from 1995 to 2001, and then as the Edward Jones Dome from 2002 to 2016, was constructed largely to lure an NFL team back to St. Louis and to serve as a convention center. The Dome provides multiple stadium configurations that can seat up to 70,000 people. Seating levels include a private luxury suite level with 120 suites, a private club seat and luxury suite level with 6,400 club seats, a concourse level (lower bowl) and a terrace level (upper bowl). The Dome opened in 1995. The Dome is part of the America's Center convention center. The convention portion has a much bigger footprint and adjoins to the west of the Dome, Cole Street to the north, Broadway to the east and Convention Plaza to the south. It is accessible off Interstate 70 eastbound at the Convention Center/Broadway/Busch Stadium exit, I-70 westbound from Illinois at the Martin Luther King Jr./Veterans Memorial Bridge, and Interstate 55 southbound at the Gateway Arch/Busch Stadium exit. The stadium is also serviced by the Convention Center MetroLink rail station.",
strStadiumLocation: "St. Louis, Missouri",
intStadiumCapacity: "66000",
strWebsite: "www.therams.com",
strFacebook: "",
strTwitter: "",
strInstagram: "",
strDescriptionEN: "The professional American football franchise now known as the Los Angeles Rams played in St. Louis, Missouri, as the St. Louis Rams from the 1995 through the 2015 seasons. The Rams franchise relocated from Los Angeles to St. Louis in 1995, which had been without a National Football League (NFL) team since the Cardinals moved to Phoenix, Arizona, in 1988. The Rams' first home game in St. Louis was at Busch Memorial Stadium against the New Orleans Saints on September 10, 1995, before the Trans World Dome (later the Edward Jones Dome, and now known as The Dome at America's Center) was completed for their November 12 game against the Carolina Panthers. Their last game played at the Edward Jones Dome in St. Louis was against the Tampa Bay Buccaneers on December 17, 2015, which they won, 31–23. The Rams' last game as a St. Louis-based club was on January 3, 2016, against the San Francisco 49ers at Levi's Stadium, where they lost in overtime 19–16.",
