strStadiumDescription: "Raymond James Stadium, also known as 'Ray Jay', is a multi-purpose football stadium located in Tampa, Florida. It is home to the Tampa Bay Buccaneers of the National Football League (NFL) as well as the NCAA's South Florida Bulls football team. The stadium seats 65,618. With the addition of temporary seating, it can be expanded to 75,000 for special events. Raymond James Stadium hosted Super Bowls XXXV and XLIII, as well as the 2017 College Football Playoff National Championship. It is also set to host Super Bowl LV in February 2021.",
