strStadiumDescription: "Amalie Arena is an arena in Tampa, Florida, that has been used for ice hockey, basketball, and arena football games, as well as concerts. It is home to the Tampa Bay Lightning of the National Hockey League and the Tampa Bay Storm of the Arena Football League. The building was originally known as the Ice Palace. In 2002, the building's naming rights were sold to the St. Petersburg Times, which became the Tampa Bay Times in 2012; accordingly, the arena was known as the St. Pete Times Forum from 2002 to 2012 and Tampa Bay Times Forum (2012–2014). In September 2014, the arena was renamed Amalie Arena when the naming rights were transferred to Amalie Oil Company.",
