strDescriptionEN: "The Tampa Bay Storm were a professional arena football team based in Tampa, Florida, U.S. that played in the Arena Football League (AFL). The team, along with the Chicago Bruisers, Denver Dynamite and Washington Commandos, joined the AFL in 1987 as one of the charter franchises, and by 1992 it was the last of the four still operating. The team ceased operations in 2017. The franchise was originally located in Pittsburgh, Pennsylvania, and known as the Pittsburgh Gladiators. The franchise relocated to Tampa Bay in 1991, changing its name in the process. The team played in St. Petersburg from 1991 to 1996, then in Tampa until 2008, after which point the AFL suspended operations and did not return until the 2010 season following the league's restructuring. It had been in the same city for longer than any other AFL team. During its tenure the franchise won five ArenaBowl championships. With 241 wins, the Storm had won far more games than any other team in AFL history. The club was last owned by Jeffrey Vinik, also the owner of the NHL's Tampa Bay Lightning. Home games were played at the Amalie Arena in Tampa.",
