strStadiumDescription: "Legion Field is a stadium in Birmingham, Alabama, United States, primarily designed to be used as a venue for American football, but occasionally used for other large outdoor events. The stadium opened in 1927 and is named in honor of the American Legion, a U.S. organization of military veterans. Since the 2004 removal of the upper deck, Legion Field seats approximately 71,594 spectators. At its peak it seated 83,091 people for football and had the name 'Football Capital of the South' emblazoned from the facade on its upper deck. Legion Field is colloquially called 'The Old Gray Lady' and 'The Gray Lady on Graymont'. The stadium's current primary tenant are the University of Alabama at Birmingham Blazers, a member of Conference USA.",
