strStadiumDescription: "The Rose Bowl, also known as Spieker Field at the Rose Bowl, is an American outdoor athletic stadium, located in Pasadena, California, a northeast suburb of Los Angeles. Opened in October 1922, the stadium is recognized as a National Historic Landmark and a California Historic Civil Engineering landmark. At a modern capacity of an all-seated configuration at 92,542 (making it one of the rare stadiums in college football to have such a seating arrangement; many such stadiums have bench-style seating) the Rose Bowl is the 15th-largest stadium in the world, the 11th-largest stadium in the United States, and the 10th largest NCAA stadium. One of the most famous venues in sporting history, the Rose Bowl is best known as a college football venue, specifically as the host of the annual Rose Bowl Game for which it is named. Since 1982, it has also served as the home stadium of the UCLA Bruins football team. The stadium has also hosted five Super Bowl games, second most of any venue. The Rose Bowl is also a noted soccer venue, having hosted the 1994 FIFA World Cup Final, 1999 FIFA Women's World Cup Final, and the 1984 Olympic Gold Medal Match, as well as numerous CONCACAF and United States Soccer Federation matches. The stadium and adjacent Brookside Golf and Country Club are owned by the city of Pasadena and managed by the Rose Bowl Operating Company, a non-profit organization whose board is selected by council members of the city of Pasadena. UCLA and the Pasadena Tournament of Roses also have one member on the company board.",
strStadiumLocation: "Los Angeles, California, USA",
