strStadiumDescription: "The Verizon Center, formerly known as the MCI Center, is a sports and entertainment arena in Washington, D.C. Named after its sponsor, the telecommunications company Verizon Communications, the Verizon Center has been nicknamed the 'Phone Booth' by local fans, because of its historical association with various telecommunications companies, such as MCI Inc. and Verizon. Located in the Chinatown neighborhood of Washington, D.C., the Verizon Center sits atop the Gallery Place rapid transit station of the Washington Metro.",
