strDescriptionEN: "The Washington Valor is a professional arena football team based in Washington, D.C. scheduled to begin play in the Arena Football League (AFL) in 2017. The team's planned home arena is the Verizon Center. The Valor is owned by Monument Sports and Entertainment (Ted Leonsis, chairman), which also owns the Washington Wizards of the National Basketball Association (NBA), Washington Mystics of the Women's National Basketball Association (WNBA), Washington Capitals of the National Hockey League (NHL) and the new Baltimore Brigade franchise. The initial announcement was made on February 10, 2016 of being close to a deal. The official announcement was made on March 10, 2016. The name team name Valor, and colors of red, white, blue and silver were announced on July 14, 2016. The Valor will be the first AFL franchise to play in the DC market since the Washington Commandos folded in 1990.",
